import React from 'react';


const PageError = (props) => {

    <div className="PageError">{props.error.message}</div>;
  <style>{`
  .PageError {
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    min-height: 100vh;
    width: 100%;
  }
  `}</style>
    
}

export default PageError;
